import React, {Component} from 'react'
import OptionsList from './OptionsList'

class MainScreen extends Component {
    constructor(props) {
        super(props);
        this.state = {
            route: 'main'
        }
    }

    onRouteChange = (newRoute) => {
        this.setState({
            route: newRoute
        })
    }

    render() {
        return (
            <div>
                <OptionsList routeFunction={this.onRouteChange} />
            </div>
        )
    }   
}

export default MainScreen;
